import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div class="topnav">
      <Link to="/mainhome">
        <a class="active">Home</a>
      </Link>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
      <a href="#about">About</a>
    </div>
  );
}

export default Navbar;
